import React from 'react'
import { Link, useParams } from 'react-router-dom'


interface Props{
    page:number
    setPage:(number:number)=>void
    currentPage:number
}

export default function Pagination(props:Props) {
    console.log(props.currentPage===props.page);

    return (
        <span onClick={()=>props.setPage(props.page)} className="pagination-class" >{props.page}</span> 
    )
}
